const ethWorthVolumeLabels = ["Trading", "LP", "UI Router", "crvUSD", "Lending", "DAO"];

const ethWorthColorPalette = [
    'rgba(255, 154, 162, 0.85)',
    'rgba(255, 183, 178, 0.85)',
    'rgba(255, 218, 193, 0.85)',
    'rgba(226, 240, 203, 0.85)',
    'rgba(181, 234, 215, 0.85)',
    'rgba(199, 206, 234, 0.85)'
];

const ethWorthBorderColorPalette = [
    'rgb(255, 154, 162)',
    'rgb(255, 183, 178)',
    'rgb(255, 218, 193)',
    'rgb(226, 240, 203)',
    'rgb(181, 234, 215)',
    'rgb(199, 206, 234)'
];

let ethWorthChart;

function ethWorthCreateViolinChart(selectedChain) {
    const ctx = document.getElementById('ethWorthViolinChart').getContext('2d');
    const dataArrays = ethWorthVolumeLabels.map(label => ethWorthData[selectedChain][label] || []);


    const datasets = [{
        label: 'Wallet Net Worth',
        data: dataArrays,
        backgroundColor: ethWorthVolumeLabels.map((_, i) => ethWorthColorPalette[i % ethWorthColorPalette.length]),
        borderColor: ethWorthVolumeLabels.map((_, i) => ethWorthBorderColorPalette[i % ethWorthBorderColorPalette.length]),
        borderWidth: 1,
        outlierColor: '#999999',
        padding: 10,
        itemRadius: 0,
    }];

    if (ethWorthChart) {
        ethWorthChart.destroy();
    }

    ethWorthChart = new Chart(ctx, {
        type: 'violin',
        data: {
            labels: ethWorthVolumeLabels,
            datasets: datasets
        },
        options: {
            responsive: true,
            plugins: {
                legend: {
                    display: false
                },
                title: {
                    display: true,
                    text: `Distribution of the proportion of users' net worth kept on Ethereum mainnet vs other chains (${selectedChain})`
                },
                tooltip: {
                    callbacks: {
                        label: function(context) {
                            const rawData = context.raw;
                            const sortedData = [...rawData].sort((a, b) => a - b);

                            const min = sortedData[0];
                            const max = sortedData[sortedData.length - 1];
                            const mean = rawData.reduce((sum, value) => sum + value, 0) / rawData.length;

                            const mid = Math.floor(sortedData.length / 2);
                            const median = sortedData.length % 2 !== 0 ? sortedData[mid] : (sortedData[mid - 1] + sortedData[mid]) / 2;

                            const q1Index = Math.floor(sortedData.length / 4);
                            const q3Index = Math.floor(3 * sortedData.length / 4);
                            const q1 = sortedData[q1Index];
                            const q3 = sortedData[q3Index];

                            return [
                                `Min: ${min.toFixed(2)}`,
                                `Q1 (25%): ${q1.toFixed(2)}`,
                                `Median: ${median.toFixed(2)}`,
                                `Mean: ${mean.toFixed(2)}`,
                                `Q3 (75%): ${q3.toFixed(2)}`,
                                `Max: ${max.toFixed(2)}`
                            ];
                        }
                    }
                }
            },
            scales: {
                y: {
                    title: {
                        display: true,
                        text: '%age of wallet net worth held on ethereum mainnet'
                    }
                }
            }
        }
    });
}

function ethWorthOnChainChange(selectedChain) {
    ethWorthCreateViolinChart(selectedChain);
}

document.addEventListener('DOMContentLoaded', function() {
    const initialChain = createChainSelector('ethWorthChainSelector', ethWorthOnChainChange);
    ethWorthCreateViolinChart(initialChain);
});